// src/components/ScrollTriggeredNavbar.js

import React from 'react';
import { Link } from 'react-scroll';

function ScrollTriggeredNavbar() {
  return (
    <nav className="fixed top-0 left-0 w-full p-4 transition-all duration-300 bg-transparent z-50">
      <ul className="flex justify-end">
        <li className="mr-6">
          <Link to="name-occupation" spy={true} smooth={true} duration={500} className="cursor-pointer">Name and Occupation</Link>
        </li>
        <li className="mr-6">
          <Link to="about" spy={true} smooth={true} duration={500} className="cursor-pointer">About</Link>
        </li>
        <li className="mr-6">
          <Link to="portfolio" spy={true} smooth={true} duration={500} className="cursor-pointer">Portfolio</Link>
        </li>
        <li>
          <Link to="contact" spy={true} smooth={true} duration={500} className="cursor-pointer">Contact Me</Link>
        </li>
      </ul>
    </nav>
  );
}

export default ScrollTriggeredNavbar;
